.eqv    BASE_ADDRESS 0x10008000
.eqv 	SCREEN_WIDTH	64	   # framebuffer units (
.eqv 	SCREEN_HEIGHT	64
## Colors for different objects and platforms
.eqv    RED             0xFF0000
.eqv    ORANGE          0xFB8600
.eqv    YELLOW          0xEFEF7E
.eqv    BLUE            0x085eff
.eqv    WHITE		0xffffff
.eqv    BEIGE           0xffe7e6
.eqv    SILVER          0xd7d6dc
.eqv    LIGHT_BLUE      0x3583ff
.eqv    GREEN           0x00ff00
.eqv    PURPLE          0x8d008d
.eqv    PLTFRM_CLR      0xad9b91
## Base constants for game. For the most part can be modified, but it might cause some visual bugs
.eqv    GRAVITY         1     #Its possible to change gravity, but it causes bugs because of how my platform collision works
                              #that I didn't deal with for the sake of time, so leave it at 1
.eqv    SIDEMOVE        2
.eqv    JUMP_HEIGHT     -3
# 0 - stage 1 (standard platformer), 1 - stage 2 (falling)
# 2 - stage 3 (wall skip), 3 - stage 4 (teleport), 4 - bonus, 6 - start stage, 7 - demo stage
.eqv    START_STAGE    6
.data
PLAYER_LOC:     .word 0, 48   # Array for player location. Values set at start don't matter
VERTICAL:       .word GRAVITY # How much 'jump' the player has
str1:           .asciiz   "Here\n" #Debugging
str2:           .asciiz   "\n"
hp:             .word 0    # HP counter
jump_counter:   .word 1    # How many jumps the player can make. For double jumps
