#Macros for common info
.macro xy_coords
       la $s0, PLAYER_LOC
       lw $s1, 0($s0)
       lw $s2, 4($s0)
.end_macro

.macro char_address(%x, %y)
       la $t6, BASE_ADDRESS   #t6 = address of framebuffer
       sll $t8, %x, 2        #t8 = 4x
       sll $t9, %y, 8        #t9 = 4*64y
       add $t7, $t8, $t9      #t7 = offset from framebuffer
       add $t7, $t7, $t6      #t7 = player address
.end_macro       
##two debugging macros during coding
.macro debug1
       li $v0, 4             #load command
       la $a0, str1          #save str1 for syscall
       syscall               #print str1
.end_macro

.macro debug2 (%reg)
       li $v0, 1
       add $a0, %reg, $zero
       syscall               #print do_addition return
       li $v0, 4             #load command
       la $a0, str2          #save str1 for syscall
       syscall               #print str1
.end_macro

.macro push (%reg)
       addi $sp, $sp, -4
       sw %reg, 0($sp)
.end_macro

.macro pop (%reg)
       lw %reg, 0($sp)
       addi $sp, $sp, 4
.end_macro

.globl main
## I used 4 saved registers that hold the same info
## $s1 - x position, $s2 - y position, $s3 - current playing stage, $s4 - player's jump height
## also from one of the macros below, $t7 is generally the player's address. NOT ALWAYS UP TO DATE
main:
reset_game:
       jal clear_screen
       li $a0, 0
       li $s4, JUMP_HEIGHT #set base jump height
       jal hp_change    #add 3 hp
       jal hp_change
       jal hp_change
      # jal hp_change    #demo code
      # jal hp_change
      # jal hp_change
       li $s3, START_STAGE
begin: move $a0, $s3
       jal draw_stage
       jal add_hell
       li $a0, 1
       jal draw_player
       la $t0, hp
       lw $t0, 0($t0)
       beq $t0, 0, GAME_OVER#change to game over
loop:  #main game loop
       li $a0, 0
       jal draw_player
       jal update_player  
       jal collision_check  
       li $a0, 1
       jal draw_player
       li $v0, 32
       li $a0, 40
       syscall
       j loop
GAME_OVER:  #print game over screen
       jal clear_screen  ###change to game over
       li $t0 22
       li $t1, 23
       char_address ($t0, $t1) #address of pixel to start at
       li $t0, WHITE
       sw $t0, 4($t7) #row 1
       sw $t0, 8($t7)
       sw $t0, 24($t7)
       sw $t0, 28($t7)
       sw $t0, 40($t7)
       sw $t0, 56($t7)
       sw $t0, 64($t7)
       sw $t0, 68($t7)
       sw $t0, 72($t7)
       sw $t0, 76($t7)
       sw $t0, 256($t7) #row 2
       sw $t0, 276($t7)
       sw $t0, 288($t7)
       sw $t0, 296($t7)
       sw $t0, 300($t7)
       sw $t0, 308($t7)
       sw $t0, 312($t7)
       sw $t0, 320($t7)
       sw $t0, 512($t7)
       sw $t0, 520($t7)
       sw $t0, 524($t7)
       sw $t0, 532($t7)
       sw $t0, 536($t7)
       sw $t0, 540($t7)
       sw $t0, 544($t7)
       sw $t0, 552($t7)
       sw $t0, 560($t7)
       sw $t0, 568($t7)
       sw $t0, 576($t7)
       sw $t0, 580($t7)
       sw $t0, 584($t7)
       sw $t0, 768($t7) #row 4
       sw $t0, 780($t7)
       sw $t0, 788($t7)
       sw $t0, 800($t7)
       sw $t0, 808($t7)
       sw $t0, 824($t7)
       sw $t0, 832($t7)
       sw $t0, 1028($t7) #row 5
       sw $t0, 1032($t7)
       sw $t0, 1044($t7)
       sw $t0, 1056($t7)
       sw $t0, 1064($t7)
       sw $t0, 1080($t7)
       sw $t0, 1088($t7)
       sw $t0, 1092($t7)
       sw $t0, 1096($t7)
       sw $t0, 1100($t7)
       sw $t0, 1540($t7) #row 6
       sw $t0, 1544($t7)
       sw $t0, 1556($t7)
       sw $t0, 1572($t7)
       sw $t0, 1580($t7)
       sw $t0, 1584($t7)
       sw $t0, 1588($t7)
       sw $t0, 1592($t7)
       sw $t0, 1600($t7)
       sw $t0, 1604($t7)
       sw $t0, 1608($t7)
       sw $t0, 1792($t7) #row 7
       sw $t0, 1804($t7)
       sw $t0, 1812($t7)
       sw $t0, 1828($t7)
       sw $t0, 1836($t7)
       sw $t0, 1856($t7)
       sw $t0, 1868($t7)
       sw $t0, 2048($t7) #row 8
       sw $t0, 2060($t7)
       sw $t0, 2072($t7)
       sw $t0, 2080($t7)
       sw $t0, 2092($t7)
       sw $t0, 2096($t7)
       sw $t0, 2100($t7)
       sw $t0, 2112($t7)
       sw $t0, 2116($t7)
       sw $t0, 2120($t7)
       sw $t0, 2304($t7) #row 9
       sw $t0, 2316($t7)
       sw $t0, 2328($t7)
       sw $t0, 2336($t7)
       sw $t0, 2348($t7)
       sw $t0, 2368($t7)
       sw $t0, 2376($t7)
       sw $t0, 2564($t7) #row 10
       sw $t0, 2568($t7)
       sw $t0, 2588($t7)
       sw $t0, 2604($t7)
       sw $t0, 2608($t7)
       sw $t0, 2612($t7)
       sw $t0, 2616($t7)
       sw $t0, 2624($t7)
       sw $t0, 2636($t7)
GAME_OVER_LOOP:       
       beq $t0, 113, END  #wait for input of either reset (p) or quit (q)
       li $t0, 0xffff0000
       lw $t1, 0($t0)
       bne $t1, 1, GAME_OVER_LOOP
       lw $t0, 4($t0)
       beq $t0, 112, RESTART
       j GAME_OVER_LOOP
END:
       jal clear_screen  #when q is pressed from game over, quit game gracefully
       li $v0, 10
       syscall
       
clear_screen:
       li $t1, 4096
       sll $t1, $t1, 2
       li $t0, BASE_ADDRESS	# load start address into $t0
       addi $t1, $t1, BASE_ADDRESS	# load final address into $t1
clear_screen_loop:
	sw $zero, 0($t0)		# clear pixel
	addi $t0, $t0, 4
	ble $t0, $t1, clear_screen_loop
	jr $ra
	
update_player: #update player location
       li $t0, 0xffff0000  #get input. up, left, right, reset, quit
       lw $t1, 0($t0)
       
       la $t3, VERTICAL   #before anything, apply their vertical movement
       lw $t4, 0($t3)
       add $s2, $s2, $t4
       beq $t4, GRAVITY,  cont  #if player is not actively falling, decrease the next vertical movement
       addi $t4, $t4, GRAVITY
       sw $t4, 0($t3)

cont:  push ($ra)
       jal update_char_array
       pop ($ra)                #update the player's location
       
       bne $t1, 1, end_player_update   #no key input
       lw $t0, 4($t0)
       
       beq $t0, 119, UP
       beq $t0, 97, LEFT
       beq $t0, 100, RIGHT
       beq $t0, 112, RESTART
       beq $t0, 113, GAME_OVER    #if q is pressed end game
#       beq $t0, 115, DOWN        #no need for down
       jr $ra
UP:    #decrease jump counter, check for platforms to reset jump counter, if there is a jump counter, modify the vertical movement
##jump works by constantly updating the players vertical movement by VERTICAL. Generally this is 1 pixel down from graivty
##if the player jumps, it increases VERTICAL, and then for each game loop after it will decrease VERTICAL by 1
##until VERTICAL returns to base, ie. GRAVITY
       la $t8, jump_counter
       lw $t9, 0($t8)
       blez $t9, skip_jump_calc
       addi $t9, $t9, -1
       sw $t9, 0($t8)
skip_jump_calc:
       li $a1, 1
       char_address($s1, $s2)
       move $a0, $t7
       push ($ra)
       jal platform_check
       pop ($ra)      
       la $t8, jump_counter
       lw $t9, 0($t8)
       beq $t9, 0, update_char_array
       la $t3, VERTICAL
       li $t4, 0
       add $t4, $t4, $s4
       sw $t4, 0($t3)

       j update_char_array
LEFT:    
       addi $s1, $s1, -SIDEMOVE
       addi $s2, $s2, -GRAVITY  #counter gravity for better movement
       j update_char_array     
RIGHT:    
       addi $s1, $s1, SIDEMOVE
       addi $s2, $s2, -GRAVITY  #^^
       j update_char_array 
#DOWN:    
#       addi $s2, $s2, 1
update_char_array:
       blt $s1, 0, end_player_update  #check if x is past the edge
       bgt $s1, 63, end_player_update
      
       blt $s2, 2, end_player_update  #check y
       bgt $s2, 63, end_player_update

       char_address($s1, $s2)
       move $a0, $t7
       push($ra)
       li $a1, 0
       jal platform_check            #checks any platform collisions so player doesn't go through
       pop($ra)
       beq $v0, 0, end_player_update
      
       sw $s1, 0($s0)
       sw $s2, 4($s0)
end_player_update:
       jr $ra
#$a0 as argument for which sprite to draw
draw_player:
       xy_coords
       char_address($s1, $s2)
       beq $a0, 0, clear_player   #different player sprites for different scenarios based on argument
       beq $a0, 2, hit_object
       beq $a0, 4, create_burned_big
       beq $a0, 5, create_burned_small
       beq $a0, 6, portal_player
       li $t4, BEIGE
       li $t5, BLUE
       li $t6, WHITE
       j create_player
portal_player:  #following three just set colors
       li $t4, LIGHT_BLUE
       li $t5, LIGHT_BLUE
       li $t6, LIGHT_BLUE
       j create_player
clear_player:
       li $t4, 0
       li $t5, 0
       li $t6, 0
       j create_player
hit_object:
       li $t4, RED
       li $t5, BLUE
       li $t6, WHITE
create_player:  #default drawing player
       sw $t6, 0($t7)
       sw $t6, 4($t7)
       sw $t5, -256($t7)
       sw $t5, -252($t7)
       sw $t4, -512($t7)
       sw $t4, -508($t7)
       jr $ra
create_burned_big: #custom sprite for when the player burns
       li $t4, RED
       li $t5, YELLOW
       li $t6, ORANGE
       beq $s1, 0, left_edge
       sw $t4, -4($t7)
       sw $t4, -260($t7)
left_edge:  #make sure sprite doesn't go over screen edge
       beq $s1, 64, right_edge
       sw $t4, 8($t7)
       sw $t4, -248($t7)
right_edge:    
       sw $t5, 0($t7)
       sw $t5, 4($t7)
       sw $t5, -256($t7)
       sw $t6, -252($t7)
       sw $t6, -512($t7)
       sw $t4, -508($t7)
       sw $t4, -768($t7)
       jr $ra
create_burned_small:  #next frame in burn animation
       li $t4, RED
       li $t5, YELLOW
       li $t6, ORANGE
       sw $zero, -4($t7)
       sw $t5, 0($t7)
       sw $t5, 4($t7)
       sw $zero, 8($t7)
       sw $zero, -260($t7)
       sw $t4, -256($t7)
       sw $t6, -252($t7)
       sw $zero, -248($t7)
       sw $zero, -512($t7)
       sw $t4, -508($t7)
       sw $zero, -768($t7)
       jr $ra
       
draw_stage: #takes argument $a0 for stage to generate
        li $t1, SCREEN_WIDTH
        mul $t1, $t1, 51  #all stages are black from below this pixel for the flames, so don't need to draw these
        sll $t1, $t1, 2
        li $t0, BASE_ADDRESS	# load start address into $t0
        addi $t1, $t1, BASE_ADDRESS	# load final address into $t1
