        #takes 1 argument. if 1 only check feet
platform_check:#checks for platform collisions on all sides of player
       li $t6, PLTFRM_CLR
       beq $a1, 1, base
       lw $t8, -256($a0)
       beq $t8, $t6, touching_platform
       lw $t8, -252($a0)
       beq $t8, $t6, touching_platform
       lw $t8, -512($a0)
       beq $t8, $t6, touching_platform_head
       lw $t8, -508($a0)
       beq $t8, $t6, touching_platform_head
base:  #only feet check
     #  li $t9, GRAVITY             #attempt to allow gravity to be changed. did not work, but leaving here for future
     #  addi $t9, $t9, -1
     #  addi $t9, $t9, GRAVITY
     #  mul $t9, $t9, 256
     #  add $a0, $a0, $t9
       lw $t8, 0($a0)
       beq $t8, $t6, touching_platform
       lw $t8, 4($a0)
       beq $t8, $t6, touching_platform
       li $v0, 1
       jr $ra
touching_platform:
       la $t8, jump_counter  #if touching a platform, give player two jumps. Double jump. For single jump, set to 1
       li $t9, 2 #1 here for single
       sw $t9, 0($t8)
touching_platform_head:#attempt to fix infinite jump when head is bumping against platform
       li $v0, 0
       jr $ra
       
RESTART: #pressing p from anywhere. Jumps to as if the game was just being opened, so only reset HP
       xy_coords
       la $t0, hp
       li $t1, 0
       sw $t1, 0($t0)
       j reset_game
       
collision_check:#checks if player collides into any objects
        xy_coords
        char_address ($s1, $s2) #get player address
        li $t8, RED  #each object is a set color, so check if the player has hit any of these colors
        li $t6, SILVER
        li $t5, LIGHT_BLUE
        li $t4, GREEN
        li $t3, WHITE
        li $t2, PURPLE
        
        lw $t9, 0($t7) #load each pixel of player to check
        beq $t8, $t9, hit_fire
        beq $t6, $t9, hit_spike
        beq $t5, $t9, hit_portal
        beq $t4, $t9, pickup_hp
        beq $t3, $t9, unlock_potential
        beq $t2, $t9, teleport
        
        lw $t9, 4($t7)
        beq $t8, $t9, hit_fire
        beq $t6, $t9, hit_spike
        addi $t7, $t7, 4
        beq $t5, $t9, hit_portal
        beq $t4, $t9, pickup_hp
        beq $t3, $t9, unlock_potential
        beq $t2, $t9, teleport
        
        addi $t7, $t7, -512  #this way of adding to $t7 rather than using i lets me know which part of player is hitting the object
        lw $t9, 0($t7)        #pixel order is also optimized to be bottom, top, middle since thats the order which a player is most likely to hit with
        beq $t5, $t9, hit_portal
        beq $t4, $t9, pickup_hp
        beq $t3, $t9, unlock_potential #dont need to check for teleport on head since its not possible to only be hitting it with your head
        
        addi $t7, $t7, -4
        lw $t9, 0($t7)
        beq $t5, $t9, hit_portal
        beq $t4, $t9, pickup_hp
        beq $t3, $t9, unlock_potential
        
        addi $t7, $t7, 256
        lw $t9, 0($t7)
        beq $t5, $t9, hit_portal
        beq $t4, $t9, pickup_hp
        beq $t3, $t9, unlock_potential
        beq $t2, $t9, teleport
        
        addi $t7, $t7, 4
        lw $t9, 0($t7)
        beq $t5, $t9, hit_portal
        beq $t4, $t9, pickup_hp
        beq $t3, $t9, unlock_potential
        beq $t2, $t9, teleport
stop_collision_check:
        jr $ra #not hitting anything
hit_fire:  
        li $a0, 2
        jal draw_player
        li $v0, 32
        li $a0, 400
        syscall
        li $a0, 4
        jal draw_player
        li $a0, 200
        syscall
        li $a0, 5
        jal draw_player
        li $a0, 200
        syscall
        li $a0 0
        jal draw_player  #quick animation of player getting hit with fire. Looks like they burn away
        li $a0, 1        #load argument for health
        jal hp_change    #decrease health
        j REGENERATE     #regenerate
hit_spike:
        li $a0, 2
        jal draw_player
        li $v0, 32
        li $a0, 400
        syscall
        sw $zero, -512($t7)
        sw $zero, -508($t7)
        li $a0, 200
        syscall
        sw $zero, -256($t7)
        sw $zero, -252($t7)
        syscall
        sw $zero, 0($t7)
        sw $zero, 4($t7)
        syscall   #animation for hitting spike
        li $a0, 1
        jal hp_change  #same as fire
        j REGENERATE
hit_portal:
        move $t1, $t7
        li $a0, 1
        jal draw_player
        li $v0, 32
        li $a0, 400
        syscall
        li $a0, 6
        jal draw_player
        li $a0, 400
        syscall
        li $a0, 0
        jal draw_player
        li $t4 LIGHT_BLUE
        sw $t4, 0($t1)
        li $a0, 400
        syscall  #animation for hitting portal
        j stage_complete  #clear screen and next stage
REGENERATE: #jumps to part in main function where everything is being printed after being set
            #this keeps the same stage, maintains the health, and resets the player location to the start for stage
        j begin

pickup_hp:  #what happens if you hit hp
        push ($ra)
        push ($t7)
        li $a0, 0
        jal hp_change  #increase it
        pop ($t1)
        li $a0, 0
        jal clear_pickup #clear the powerup
        pop ($ra)
        jr $ra

unlock_potential: #permanently increase jump height
        push ($ra)
        beq $s4, -4, max_potential #you can only do it once
        addi $s4, $s4, -1
max_potential:
        li $a0, 1
        move $t1, $t7
        jal clear_pickup
        pop ($ra)
        jr $ra

teleport: #move player 32 pixels right
        xy_coords
        addi $s1, $s1, 32 #move player 32 pixels right
        move $t1, $t7
        li $a0, 2
        push ($ra)
        push ($t1)
        jal clear_pickup  #clear teleport powerup
        pop ($t1)
        pop ($ra)
        
        li $t0, 0
        add $t0, $t0, $t1
        li $t2, 32
        li $t3, 0
        li $t4, PURPLE
        li $v0, 32
        li $a0, 10  #load stuff for animation
teleport_animation:
        sw $t4, 0($t0)
        syscall
        sw $zero, 0($t0)
        addi $t0, $t0, 4
        addi $t3, $t3, 1
        bne $t2, $t3, teleport_animation  #loop to draw and undraw a pixel across the screen to show teleporting
        push ($ra)
        jal update_char_array #update player location
        pop ($ra)
        jr $ra
        
#takes argument for which type of powreup it should be clearing
clear_pickup:  #crecursive function to remove powreup
               #each powerup is the same color and each pixel is adjacent to another one of the powerup,
               #so it recursively checks all 4 adjacent pixels from the origin and spreads
               #to reset everything of the same color to black
        beq $a0, 0, p1
        beq $a0, 1, p2
        beq $a0, 2, p3
p1:     li $t2 GREEN
        j continue_clear_pickup
p2:     li $t2 WHITE
        j continue_clear_pickup    
p3:     li $t2 PURPLE
continue_clear_pickup:   
        sw $zero, 0($t1)
         push ($t1)
         push ($ra)
        lw $t3, 4($t1)
        beq $t3, $t2, right_pxl
        lw $t3, -4($t1)
        beq $t3, $t2, left_pxl
        lw $t3, 256($t1)
        beq $t3, $t2, down_pxl
        lw $t3, -256($t1)
        beq $t3, $t2, up_pxl
        j end_pickup_clear
right_pxl: 
        addi $t1, $t1, 4  #moves origin in appropriate direction for next recursive call
        jal clear_pickup
left_pxl:
        addi $t1, $t1, -4
        jal clear_pickup
down_pxl:
        addi $t1, $t1, 256
        jal clear_pickup
up_pxl:
        addi $t1, $t1, -256
        jal clear_pickup
end_pickup_clear:
        pop ($ra)
        pop ($t1)
        jr $ra      
        
#takes argument to add or subtract 1 HP. 0: add, 1: remove
hp_change:   #makes changes to HP
       la $t1, hp
       lw $t2, 0($t1)
       li $t3, 3
       li $t4, 63
       char_address ($t3, $t4)  #origin line for where to be drawing hearts
       beq $a0, 1, lose_hp      #if argument is 1, jump to removing process
       beq $t2, 5, end_hp_change#since not removing, add. if hp is 5 dont add anymore. Can change this to whatever limit
       mul $t3, $t2, 24 #process to calculate where to draw the next heart
       add $t7, $t3, $t7
       addi $t2, $t2, 1  #add 1 HP
       sw $t2, 0($t1)
       li $t0, RED
       j apply_hp_change
lose_hp:  #process to calculate which heart is being removed
       addi $t2, $t2, -1  #remove one HP
       sw $t2, 0($t1)
       mul $t3, $t2, 24
       add $t7, $t3, $t7
       li $t0, 0
apply_hp_change: #draw heart/undraw heart
       sw $t0, 0($t7) #row 1
       sw $t0, -260($t7) #row 2
       sw $t0, -256($t7) 
       sw $t0, -252($t7)
       sw $t0, -520($t7) #row 3
       sw $t0, -516($t7)
       sw $t0, -512($t7)
       sw $t0, -508($t7)
       sw $t0, -504($t7)
       sw $t0, -776($t7) #row 4
       sw $t0, -772($t7)
       sw $t0, -764($t7)
       sw $t0, -760($t7)
end_hp_change:
       jr $ra
